import React, { useEffect } from 'react';
import Navbar from '../components/Navigation/Navbar';
import { connect } from 'react-redux';
import { checkAuthenticated, load_user } from '../actions/auth';

const Layout = (props) => {

    useEffect(() => {
        checkAuthenticated();
        load_user();
    }, []);

    return (
        <div>
        <Navbar />
        {props.children}
    </div>
    )

};

export default connect(null, {})(Layout);
